import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter, Switch, Route } from 'react-router-dom';


ReactDOM.render(
  <BrowserRouter>
    <Switch>
      <Route path="/" component={App} exact/>
      <Route component={App} />
    </Switch>
  </BrowserRouter>,
  //<React.StrictMode>
  //</React.StrictMode>,
  document.getElementById('root')
);
